        { id: 3, name: "Masha" },
        { id: 4, name: "Dasha" }
    ],
    messageData : [
        { id: 0, message: 'Hello' },
        { id: 1, message: 'How are you' },
        { id: 2, message: 'Yo' }
    ]
}

